import React from 'react'
import Button from './Button';
import TextField from "@mui/material/TextField";

const Nav = ({keyword,setKeyword}) => {
    const searchBar = ({width:"20rem",background:"#F2F1F9", border:"none", padding:"0.5rem"})
    let Links =[
        {name: 'HOME',link:'/home'},
        {name: 'SERVICES',link:'/services'},
        {name: 'ABOUT',link:'/about'},
        {name: 'BLOG',link:'/blog'},
        {name: 'CONTACTS',link:'/contacts'},
    ];
    return (
    <div className='shadow-md w-full fixed top-0 left-0'>
        <div className='md:flex items-center justify-between py-4 sticky md:px-10 px-7'>
            <div className='font-bold text-2xl cursor-pointer flex items-center font-[Poppins] text-white'>
                <span className='text-3xl mr-1 pt-2 icon-ionic'>
                <ion-icon name="logo-ionic"></ion-icon>
                </span>
                <h1 className='text-black px-4'>Planetary Stadium</h1>
            </div>
            <ul className='md:flex md:items-center md:pb-0 pb-12 absolute md:static md:z-auto z-[-1] left-0 w-full md:w-auto md:pl-0 pl-0 transition-all duration-500 ease-in'>
                {
                    Links.map((link)=>(
                        <li key={link.name} className='md:ml-8 text-xl md:my-0 my-7'>
                            <a href={link.link} className='text-white hover:text-gray-400 duration-500 pl-7'>{link.name}</a>
                        </li>
                    ))
                }
                <Button className='items-center'>Get Started</Button>
                {/* <Button>Read More</Button> */}
            </ul>
            <div className=''>
            <input
                style={searchBar}
                key="random1"
                value={keyword}
                placeholder={"Search Country"}
                onChange={(e)=> setKeyword(e.target.value)}
            />
            </div>
        </div>

    </div>
  )
}

export default Nav
